import { motion } from "framer-motion";
import React from "react";
import Skill from "./Skill";
import cssLogo from '../images/css.png'

type Props = {};

function Skills({}: Props) {
  return (
    <motion.div
      initial={{
        opacity: 0,
      }}
      whileInView={{
        opacity: 1,
      }}
      transition={{
        duration: 1.5,
      }}
      className="h-screen flex relative
       overflow-hidden flex-col text-center
       md:text-left xl:flex-row max-w-[2000px]
       xl:px-10 min-h-screen justify-center
       xl:space-y-2 mx-auto items-center
       "
    >
      <h3
        className="absolute top-24 
      uppercase tracking-[20px]
       text-gray-500 text-2xl"
      >
        Skills
      </h3>

      
      <div className="grid mt-16 grid-cols-4 
      gap-5  mb-8">
        <Skill set="CSS" img="data:image/png;base64," />
        <Skill set="FireB" img="data:image/png;base64,"/>
        <Skill set="HTML" img="data:image/png;base64,"/>
        <Skill set="JS" img="data:image/png;base64,"/>
        <Skill set="Next" img="https://miro.medium.com/max/1000/1*htbUdWgFQ3a94PMEvBr_hQ.png"/>
        <Skill set="React" img="data:image/png;base64,"/>
        <Skill set="Redux" img="data:image/png;base64,"/>
        <Skill set="Sanity" img="data:image/jpeg;base64,"/>
        <Skill set="Git" img="data:image/png;base64,"/>
        <Skill set="Github" img="data:image/jpeg;base64,"/>
        <Skill set="Tailwind" img="data:image/png;base64,"/>
        <Skill set="Nodejs" img="data:image/png;base64,"/>
        <Skill set="Express" img="data:image/jpeg;base64,"/>
        <Skill set="JQuery" img="data:image/png;base64,"/>
        <Skill set="C++" img="data:image/png;base64,"/>
        <Skill set="DSA" img="data:image/png;base64,"/>
        

      
      </div>
    </motion.div>
  );
}

export default Skills;
